import React, { useState, useEffect } from 'react';

const ClienteDashboard = ({ onNavigate }) => {
  const [reservas, setReservas] = useState([]);
  const [notificacoes, setNotificacoes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('reservas');
  const [profileData, setProfileData] = useState({
    nome: '',
    email: '',
    telefone: ''
  });

  useEffect(() => {
    fetchReservas();
    fetchNotificacoes();
    fetchProfile();
  }, []);

  const fetchReservas = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/reservas/cliente', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      const data = await response.json();
      if (!response.ok) throw new Error(data.mensagem);
      setReservas(data);
    } catch (err) {
      setError('Erro ao carregar reservas');
    }
  };

  const fetchNotificacoes = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/notificacoes', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      const data = await response.json();
      if (!response.ok) throw new Error(data.mensagem);
      setNotificacoes(data);
    } catch (err) {
      setError('Erro ao carregar notificações');
    }
  };

  const fetchProfile = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/usuarios/perfil', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      const data = await response.json();
      if (!response.ok) throw new Error(data.mensagem);
      setProfileData(data);
    } catch (err) {
      setError('Erro ao carregar perfil');
    } finally {
      setLoading(false);
    }
  };

  const handleCancelarReserva = async (reservaId) => {
    try {
      const response = await fetch(`http://localhost:3001/api/reservas/${reservaId}/cancelar`, {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      if (!response.ok) throw new Error('Erro ao cancelar reserva');
      fetchReservas();
    } catch (err) {
      setError('Erro ao cancelar reserva');
    }
  };

  const handleMarcarNotificacaoLida = async (notificacaoId) => {
    try {
      const response = await fetch(`http://localhost:3001/api/notificacoes/${notificacaoId}/lida`, {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      if (!response.ok) throw new Error('Erro ao marcar notificação como lida');
      fetchNotificacoes();
    } catch (err) {
      setError('Erro ao marcar notificação como lida');
    }
  };

  const handleProfileUpdate = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:3001/api/usuarios/perfil', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        },
        body: JSON.stringify(profileData)
      });
      if (!response.ok) throw new Error('Erro ao atualizar perfil');
      setError('');
    } catch (err) {
      setError('Erro ao atualizar perfil');
    }
  };

  if (loading) {
    return <div className="loading">Carregando...</div>;
  }

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <button 
          className={`nav-tab ${activeTab === 'reservas' ? 'active' : ''}`}
          onClick={() => setActiveTab('reservas')}
        >
          Reservas
        </button>
        <button 
          className={`nav-tab ${activeTab === 'notificacoes' ? 'active' : ''}`}
          onClick={() => setActiveTab('notificacoes')}
        >
          Notificações
          {notificacoes.filter(n => !n.lida).length > 0 && (
            <span className="notification-badge">
              {notificacoes.filter(n => !n.lida).length}
            </span>
          )}
        </button>
        <button 
          className={`nav-tab ${activeTab === 'perfil' ? 'active' : ''}`}
          onClick={() => setActiveTab('perfil')}
        >
          Perfil
        </button>
        <button 
          className="nav-tab"
          onClick={() => {
            localStorage.removeItem('token');
            onNavigate('landing');
          }}
        >
          Sair
        </button>
      </nav>

      <div className="dashboard-content">
        {error && <div className="error-message">{error}</div>}

        {activeTab === 'reservas' && (
          <div>
            <h2>Minhas Reservas</h2>
            {reservas.length === 0 ? (
              <p className="no-data">Nenhuma reserva encontrada</p>
            ) : (
              <div className="reservas-grid">
                {reservas.map(reserva => (
                  <div key={reserva.id} className="reserva-card">
                    <div className="reserva-header">
                      <h3>Reserva #{reserva.id}</h3>
                      <span className={`status-badge ${reserva.status}`}>
                        {reserva.status}
                      </span>
                    </div>
                    <div className="reserva-details">
                      <p>Veículo: {reserva.veiculo.marca} {reserva.veiculo.modelo}</p>
                      <p>Data: {new Date(reserva.data).toLocaleDateString()}</p>
                      <p>Preço: R$ {reserva.preco.toFixed(2)}</p>
                    </div>
                    {reserva.status === 'pendente' && (
                      <button 
                        className="btn btn-danger"
                        onClick={() => handleCancelarReserva(reserva.id)}
                      >
                        Cancelar Reserva
                      </button>
                    )}
                  </div>
                ))}
              </div>
            )}
          </div>
        )}

        {activeTab === 'notificacoes' && (
          <div>
            <h2>Notificações</h2>
            {notificacoes.length === 0 ? (
              <p className="no-data">Nenhuma notificação encontrada</p>
            ) : (
              <div className="notificacoes-list">
                {notificacoes.map(notificacao => (
                  <div 
                    key={notificacao.id} 
                    className={`notificacao-item ${!notificacao.lida ? 'unread' : ''}`}
                  >
                    <p>{notificacao.mensagem}</p>
                    {!notificacao.lida && (
                      <button 
                        className="btn btn-secondary"
                        onClick={() => handleMarcarNotificacaoLida(notificacao.id)}
                      >
                        Marcar como lida
                      </button>
                    )}
                  </div>
                ))}
              </div>
            )}
          </div>
        )}

        {activeTab === 'perfil' && (
          <div>
            <h2>Meu Perfil</h2>
            <form onSubmit={handleProfileUpdate} className="profile-form">
              <div className="form-group">
                <label htmlFor="nome">Nome</label>
                <input
                  type="text"
                  id="nome"
                  value={profileData.nome}
                  onChange={(e) => setProfileData({...profileData, nome: e.target.value})}
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="email">Email</label>
                <input
                  type="email"
                  id="email"
                  value={profileData.email}
                  onChange={(e) => setProfileData({...profileData, email: e.target.value})}
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="telefone">Telefone</label>
                <input
                  type="tel"
                  id="telefone"
                  value={profileData.telefone}
                  onChange={(e) => setProfileData({...profileData, telefone: e.target.value})}
                  required
                />
              </div>
              <button type="submit" className="btn btn-primary">
                Atualizar Perfil
              </button>
            </form>
          </div>
        )}
      </div>
    </div>
  );
};

export default ClienteDashboard;
